import React from 'react'; 

function Notes(props){

	const listdata={
		listStyleType:'none',
      float:'left',
      padding:'35px'


	}


		return(
			<div>
				<ul>
					<li style={listdata}><h3>{props.item}</h3></li>
				</ul>

			</div>
		)
}

export default Notes;
